import React from "react";
import "./Bus.css";
import Moment from "moment"

const bus = props => {
  return (
    <div className="Bus">
      <p>
        Numer autobusu: {props.routeId} Kierunek: {props.headsign}
      </p>
      Odjazd: <Moment fromNow ago>{props.estimatedTime}</Moment>
    </div>
  );
};

const getEstimatedInMinutes = est => {
  return "Za 8 minut" + est;
};


export default bus;
